;; gorilla-repl.fileformat = 1

;; **
;;; # Gorilla REPL
;;; 
;;; + Data is dump from Telegram, using [telegram-history-dump](https://github.com/tvdstaaij/telegram-history-dump) utility (for confidential reasons, this data is not available on repo).
;;; + Data is process by Clojure & visualize using [ggjoy](https://github.com/clauswilke/ggjoy) R library.
;; **

;; @@
(ns flowing-ocean
  (:require 
    [clj-time.core :as t]
    [clojure.java.io :as io]
    [clojure.string :as str]
    [cheshire.core :as json]
    [gg4clj.core :as gg4clj]
    [gorilla-samples.util :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn- parse-telegram [file-name]
  (->> (io/resource (str "telegram/" file-name ".jsonl"))
       slurp
       str/split-lines
       (map #(json/parse-string % true))
       (remove :service)
       (map (fn [m] (update m :date ->vn-time)))
       (map #(assoc % :day (t/day (:date %))))
       (map #(assoc % :hour (t/hour (:date %))))
       (map #(assoc % :group file-name))))

(def dat (mapcat parse-telegram ["Vn" "Hackers" "Engineering" "PCO" "Mobile-All_in" "givn_DEV" "FM-Devs" "MT-All_in"]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;flowing-ocean/dat</span>","value":"#'flowing-ocean/dat"}
;; <=

;; @@
(gg4clj/view [[:<- :g (gg4clj/data-frame {:hour (map :hour dat)
                            			  :group (map :group dat)})]
              (gg4clj/r+
                [:ggplot :g [:aes {:x :hour, :y :group, :group :group}]]
                [:geom_joy2]
                [:scale_y_discrete {:expand [:c 0.01 0]}]
                [:scale_x_continuous {:breaks [:seq 0 24 {:by 2}]
                                      :expand [:c 0 0]}]
                [:theme_joy {:font_size 9}])])
